import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  Typography,
} from "@material-ui/core";
import React from "react";
import ListProductOrder from "./../ListProductOrder";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";

export default function OrderItem({ item }) {
  return (
    <>
      <Accordion className="text-white">
        <AccordionSummary
          expandIcon={<ExpandMoreIcon sx={{ color: "white" }} />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography>{item.id}</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell className="text-white">STT</TableCell>
                <TableCell className="text-white">Name Product</TableCell>
                <TableCell className="text-white">Order Date</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {item.list.map((item, index) => {
                return (
                  <ListProductOrder key={index} index={index} item={item} />
                );
              })}
            </TableBody>
          </Table>
        </AccordionDetails>
      </Accordion>
    </>
  );
}
